Here is a simple JavaScript function that sorts an object's keys alphabetically:

```javascript
function sortDictionaryByKey(d) {
return Object.keys(d).sort();
}

// Example usage:
let myObject = { "b": 2, "a": 1, "c": 3 };
console.log(sortDictionaryByKey(myObject)); // Outputs: ["a", "b", "c"]
```
This function works by using the `keys()` method to get an array of all keys in the object and then sorting that array with the `sort()` method, which sorts strings lexicographically. The sorted keys are returned as a new array.
